import React, { Component } from "react";
import { NavbarConsumer } from "./NavbarContext";

class Navbar extends Component{

    render(){
        return (
            <NavbarConsumer>
                {(navContent) => {
                    return (
                        <ul>
                            {Object.keys(navContent).map(key => <li>{navContent[key]}</li>)}
                        </ul>
                    );
                }}
            </NavbarConsumer>
        );
    }

}

export default Navbar;
